import React from 'react';

function Entry(props) {
  console.log("entry is reached")
  console.log("Entry params are: ", props.id, props.entry)
  return(<div>
    On {props.entry.night}, you slept for {props.entry.duration} hours. Entry id is {props.id}
  </div>);
}

export default Entry
